INSERT INTO "cradmin_javascript_demos_fictionalfigure" VALUES(1,'Santa Claus','He sees you when you are sleeping, but has yet to be taken down by #metoo for some reason.',1,NULL,90);
INSERT INTO "cradmin_javascript_demos_fictionalfigure" VALUES(2,'Peter Pan','He can fly and he never grows old',0,NULL,5);
INSERT INTO "cradmin_javascript_demos_fictionalfigure" VALUES(3,'Superman','His real superpower is that nobody has killed him yet even though he always falls for the same kryptonite trap.',1,NULL,92);
INSERT INTO "cradmin_javascript_demos_fictionalfigure" VALUES(4,'Thor the god of thunder','He is kind of a god, but really just long lived + some "magic"',0,NULL,51);
INSERT INTO "cradmin_javascript_demos_fictionalfigure" VALUES(5,'Black lightning','He is black, and can shoot lightning. Damages himself with his own power so he really needs a suit that is just as bulky as the ironman suit, has less fancy features and only works for black lightning.',0,NULL,12);
INSERT INTO "cradmin_javascript_demos_fictionalfigure" VALUES(6,'Daredevil','His superpowers include scowling, not seeing, and really taking a beating without dying.',0,NULL,6);
INSERT INTO "cradmin_javascript_demos_fictionalfigure" VALUES(7,'Spiderman','He is strong, fast and has a sixth sense. Used to smart, but now he the brain stuff has been offloaded to Tony Stark.',0,NULL,57);
INSERT INTO "cradmin_javascript_demos_fictionalfigure" VALUES(8,'Supergirl','She is just like superman, but a lot more girly. For some reason she seems to be far less powerful.',0,NULL,60);
